import React from "react"
import Nav from "react-bootstrap/Nav";
import { Link } from "react-router-dom";

import NavItem from "./MainNav/NavItem";

const SecondaryNav = () => {
  const datas = [
    "IDR",
    "Account",
    "Search",
    <i class="fa-solid fa-bag-shopping" id="Open Cart"></i>
  ];

  return (
    <>
      <Nav className="navbar navbar-expand-lg secondary-nav hidden-phone">
        {datas.map((data, i) => {
          return <NavItem data={data} key={i} />
        })}
      </Nav>
      <Link to="#" className="hidden-desk">
        <i class="fa-solid fa-user"></i>
      </Link>
      <Link to="#" className="hidden-desk">
        <i class="fa-solid fa-magnifying-glass"></i>
      </Link>
      <Link to="#" className="hidden-desk">
      <i class="fa-solid fa-bag-shopping" id="Open Cart"></i>
      </Link>
    </>

  )
}

export default SecondaryNav
